// index.js or root file
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import { ClerkProvider, ClerkLoaded } from '@clerk/clerk-react';
import App from './App'; // Assuming your main app component is named App

if (!process.env.REACT_APP_CLERK_PUBLISHABLE_KEY) {
  throw new Error("Missing Clerk Frontend API key");
}

ReactDOM.render(
  <React.StrictMode>
    <ClerkProvider
      frontendApi={process.env.REACT_APP_CLERK_FRONTEND_API}
      navigate={(to) => {
        // Add any custom navigation logic if needed
        window.location.href = to;
      }}
    >
      <ClerkLoaded>
        <Router>
          <App />
        </Router>
      </ClerkLoaded>
    </ClerkProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
